import { useGetContactsQuery } from 'Redux/ContactsSlice';
import { ContactList } from './ContactLList/ContactList';
export function App() {
  const { data } = useGetContactsQuery();
  console.log(data);
  return (
    <>
      <h1>Phonebook</h1>

      <h2>Contact List</h2>
      {data ? <ContactList contacts={data} /> : <p>No any contacts</p>}
    </>
  );
}
